import React from "react";

const NavBar = () => {
    return(
        <nav>
            <ul>
                <li className="white">About me</li>
                <li>Projects</li>
                <li>CV</li>
                <li>Contact me</li>
            </ul>
        </nav>
    )
}
export default NavBar;
